import React from 'react';

import '../layout/menubar';
import { Topbar } from '../layout/topbar';
import { Menubar } from '../layout/menubar';
import Chart from './chart';
import AllAbout from './allabout';
import sttdc from './sttdc.svg';
import { BsCalendar2Check, BsCalendarEvent } from 'react-icons/bs';




class Dashboard extends React.Component {
    render() {
        return (
            <div className='bg'>
                <div className="Backgroundapp">
                    <span className='title-report-type'>Biểu đồ cấp số</span>
                    <div className='report-chart-type-list'>

                        <div className='report-chart-type-item'>
                            <div className='title-chart-type-item-name'>
                                <div className='title-chart-type-item-name-img'><BsCalendarEvent className='imglogo' /></div>
                                <p>Số thứ tự đã cấp</p>
                            </div>
                            <div className='title-chart-type-item-name'>

                                <label className='solieu'>4520</label>
                                <div className='phantram'><a>23%</a></div>
                            </div>
                        </div>
                        <div className='report-chart-type-item'>
                            <div className='title-chart-type-item-name'>
                                <div className='title-chart-type-item-name-img' style={{ color: "g" }}><BsCalendar2Check className='imglogo' style={{ color: '#35C75A' }} /></div>
                                <p>Số thứ tự đã cấp</p>
                            </div>
                            <div className='title-chart-type-item-name'>

                                <label className='solieu'>4520</label>
                                <div className='phantram'><a>23%</a></div>
                            </div>
                        </div>
                        <div className='report-chart-type-item'>a</div>
                        <div className='report-chart-type-item'>a</div>
                    </div>
                    <Chart defaulchart='ngày' />
                    <AllAbout />
                    <Topbar nametitle1='' nametitle2='' nametitle3='Dashboard' href='' />
                    <Menubar buttonid="db" />

                </div>
            </div>
        );

    }


}

export default Dashboard;
